import Slot from "./slot";
import {
  Container,
  Button,
  Grid,
  Paper,
  Typography,
} from "@material-ui/core";

function Parkingslots() {
  return (
    <Container alignItems="center">
      <Typography
        variant="h4"
        align="center"
        component="h1"
        style={{ padding: 16 }}
      >
        Parking Slots
      </Typography>
      <Paper style={{ padding: 16 }}>
        <Grid container justify="center" alignItems="center" spacing={2}>

        </Grid>
      </Paper>
    </Container>
  );
}

export default Parkingslots;
